import React, { useState } from "react";

const CheckInPage = () => {
  const [flightNumber, setFlightNumber] = useState("");
  const [lastName, setLastName] = useState("");
  const [passportNumber, setPassportNumber] = useState("");
  const [luggageOption, setLuggageOption] = useState("");
  const [checkInStatus, setCheckInStatus] = useState<string | null>(null);

  const handleCheckIn = (e: React.FormEvent) => {
    e.preventDefault();

    if (flightNumber && lastName && passportNumber) {
      setCheckInStatus("Check-in reușit! Ai finalizat procedura de check-in.");
    } else {
      setCheckInStatus("Te rugăm să completezi toate câmpurile.");
    }
  };

  return (
    <div className="w-full min-h-screen bg-gray-100 flex justify-center items-center py-10 px-4">
      <div className="bg-white p-8 rounded-xl shadow-lg max-w-md w-full">
        <h2 className="text-3xl font-semibold mb-6 text-center text-gray-700">
          Completează informațiile pentru Check-in
        </h2>

        <form onSubmit={handleCheckIn} className="space-y-6">
          <div>
            <label
              htmlFor="flightNumber"
              className="block text-lg font-semibold text-gray-600"
            >
              Număr Zbor
            </label>
            <input
              type="text"
              id="flightNumber"
              value={flightNumber}
              onChange={(e) => setFlightNumber(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numărul zborului"
              required
            />
          </div>

          <div>
            <label
              htmlFor="lastName"
              className="block text-lg font-semibold text-gray-600"
            >
              Nume de familie
            </label>
            <input
              type="text"
              id="lastName"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numele tău"
              required
            />
          </div>

          <div>
            <label
              htmlFor="passportNumber"
              className="block text-lg font-semibold text-gray-600"
            >
              Număr Pașaport
            </label>
            <input
              type="text"
              id="passportNumber"
              value={passportNumber}
              onChange={(e) => setPassportNumber(e.target.value)}
              className="w-full border p-3 rounded mt-2"
              placeholder="Introdu numărul pașaportului"
              required
            />
          </div>

          <div>
            <label
              htmlFor="luggage"
              className="block text-lg font-semibold text-gray-600"
            >
              Selectează tipul de bagaj
            </label>
            <select
              id="luggage"
              value={luggageOption}
              onChange={(e) => setLuggageOption(e.target.value)}
              className="w-full border p-3 rounded mt-2"
            >
              <option value="">Fără bagaj</option>
              <option value="cabin">Bagaj de cabină (max. 8kg)</option>
              <option value="hold">Bagaj de cală (max. 23kg)</option>
              <option value="extra">Bagaj suplimentar (cost adițional)</option>
            </select>
          </div>

          <button
            type="submit"
            className="w-full bg-blue-600 text-white py-3 rounded hover:bg-blue-700 transition"
          >
            Check-in
          </button>
        </form>

        {checkInStatus && (
          <div className="mt-6 text-center text-lg font-semibold text-gray-800">
            <p>{checkInStatus}</p>
          </div>
        )}

        {checkInStatus && luggageOption && (
          <div className="mt-4 text-center text-md text-gray-700">
            <p>
              Ai selectat:{" "}
              <strong>
                {luggageOption === "cabin"
                  ? "Bagaj de cabină"
                  : luggageOption === "hold"
                  ? "Bagaj de cală"
                  : "Bagaj suplimentar"}
              </strong>
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default CheckInPage;
